import React from 'react';
import  SearchBar  from './';
import { Button } from 'semantic-ui-react';

export const Header = () => {
    return (
        <div>
            <SearchBar />
            <Button content='Logout' style={{ marginLeft: '10px' }} />
            <Button content='Add Article' style={{ marginLeft: '10px' }} />
        </div>
    );
}
